import React from "react";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";
import Navbar from "./components/Navbar";
import Home from "./Home";
import partners from "./partners";
import Card from "./Card";
import AboutUs from "./components/AboutUs";
import Awards from "./Awards";
import Footer from "./components/Footer";
import Aboutus2 from "./components/Aboutus2";
import "./App.css";

function createCard(partner) {
  return (
    <Card
      key={partner.id}
      img={partner.imgURL}
      name={partner.name}
      description={partner.description}
    />
  );
}

function App() {
  // Fix: Use absolute path for opening a new window
  const openAboutUs2 = () => {
    const baseUrl = window.location.origin; // Gets the base URL of your app
    window.open(`${baseUrl}/aboutus2`, "_blank", "noopener,noreferrer");
  };

  return (
    <Router>
      <div className="App">
        <div className="hero">
          <Navbar />
          <Home />
        </div>
        <div className="partner-container">
          {partners.map(createCard)}
          <button className="see-more"> &gt; </button>
        </div>
        <div className="awards">
          <Awards />
        </div>
        <div className="about">
          <AboutUs />
        </div>
        <div className="footer">
          <Footer />
        </div>

        {/* Example Buttons to open Aboutus2 */}
        <div className="example-buttons">
          <button onClick={openAboutUs2}>Learn More</button>
          <button onClick={openAboutUs2}>About Us Details</button>
        </div>

        <Routes>
          <Route path="/aboutus2" element={<Aboutus2 />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
